import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="content">
        {/* This is where dynamic content will be loaded */}
        <h1>Welcome to the AJS & Matchless Owners Club</h1>
        <p>Content for home, bikes, events, etc., will go here.</p>
      </div>
      <Footer />
    </div>
  );
}

export default App;
